import React from 'react'
import { useState } from 'react'
import { AppBar, IconButton, Toolbar, Typography, Stack, Button, Menu, MenuItem } from "@mui/material"
import { Link } from 'react-router-dom';
import BiotechIcon from '@mui/icons-material/Biotech'
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown'


export const Navbar = () => {
    const [anchorEl, setAchorEl] = useState<null | HTMLElement>(null)
    const open = Boolean(anchorEl)
    const handleClick = (event: React.MouseEvent<HTMLButtonElement>) => {
        setAchorEl(event.currentTarget)
    }
    const handleClose = ()=>{
        setAchorEl(null)
    }

    return (
        <AppBar position='static'>
            <Toolbar>
                <IconButton size='large' edge='start' color='inherit' aria-label='logo'>
                    <BiotechIcon/>
                </IconButton>
                <Typography variant='h6' component='div' sx={{flexGrow: 1}}>
                    GENE-Works
                </Typography>
                <Stack direction='row' spacing={2}>
                    <Button color='inherit' component={Link} to='/graph'>Graph 1</Button>
                    <Button color='inherit'>Graph 2</Button>
                    <Button id='ui-button'
                        color='inherit'
                        onClick={handleClick}
                        aria-control={open ? 'ui-menu': undefined}
                        aria-haspopup='true'
                        aria-expanded={open ? 'true' : undefined}
                        endIcon={<KeyboardArrowDownIcon/>}
                >UI</Button>
                </Stack>
                <Menu id='ui-menu' 
                    anchorEl={anchorEl}
                    open={open}
                    MenuListProps={{
                        'aria-labelledby': 'ui-button'
                    }}
                    onClose={handleClose}
                    anchorOrigin={{
                        vertical:'bottom',
                        horizontal:'right',
                    }}
                    transformOrigin={{
                        vertical: 'top',
                        horizontal: 'right'

                    }}
                >
                    <MenuItem component={Link} to='/exbox'>Box</MenuItem>
                    <MenuItem onClick={handleClose}>Next</MenuItem>
                </Menu>
            </Toolbar>
        </AppBar>
    )
}
